import React from "react";
import styles from './Header.module.css'
// in terminal:  npm install react-icons
// de pe pagina de react-icons copiem icon 
import { BsSearch } from "react-icons/bs";
import { FaReddit } from 'react-icons/fa';

function Header() {
    return (
        <div className={styles.header}>  
          <div>
            <p className={styles.logoName}><span className={styles.span}>Reddit</span>myVersion</p>
          </div>
          <form className={styles.searchForm}>
            <input className={styles.searchInput}
            type="text"
            placeholder="Search"
            id="search"
            />
            <button type="submit"  aria-label="Search" className={styles.searchButton}>
              <BsSearch size={28}/>
            </button>
          </form>
        </div>
    );
}

export default Header;
